INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (226,'071','염행의 친일도적을 피하고 밖으로 나가니 원수가 칼을 품고 달려드는 형국입니다. 문을 나서게 되면 길을 잃을 운수입니다. 전체적으로 보아 금년운은 좋지 않은 편입니다. 공고함에 지쳐 이익만 따라 행동하게 되면 배은망덕 하다고 손가락질 받게 되니 어려워도 마음을 굳게함이 옳겠습니다. 물건을 잃게 되거나 구설을 받아 억울한 입장이 되기도 하겠습니다. 그렇다고 먼길되이 먼 곳으로 피해가면 도리어 불리한 액운이 들게 됩니다. 분수를 지키면서 자중하시고 급하게 새로운 일을 꿋꿋하려 하지 마십시오. 차라리 느리게 시작함이 도리어 좋은 결과를 낳게 되겠습니다. 금년에는 집안에 질고가 있고 고통을 당하겠으며 근심이 떠나지 않겠으니 가족들이 우울하게 지내게 되겠습니다. 그러나 너무 긴장하여 태만함 속에 빠져있지 말고 노력을 하면 길운이 들어오겠습니다.','재물이 생길 운수입니다. 그러나 비록 운운이 생겨으나 얻은 후에 잠밖은 잃게 될 수도 있습니다. 또한 재물이 밖으로만 나가려 하고 내게는 모이지 않으니 애를 써도 남 것이 되지 못합니다. 먼길로 나가는 것은 좋지 않습니다. 집안에서 하던 일을 꾸준히 하십시오.','겉으로는 잘 되는 것 같아 일을 추진하지만 막상 결실을 보려하면 흉함이 있겠습니다. 마가 넘어 하는 일마다 해를 낳치니 도무지 이루어지는 일이 없겠습니다. 말을 듣고 산에 올라보니 돌아갈 길이 허심한 격입니다.','날이 밝지 못하고 운물이 구름처럼 두꺼 그 빛을 가로막았습니다. 후앙수가 있으니 매사를 조심하고 조급히 대비 하십시오. 시비를 가까이 하는 것도 좋지 않습니다. 구설이 나에게로 친척하니 주의해야 합니다.','관기가 발동하겠습니다. 남과의 거래에서도 이익을 따지다보면 나에게 불리하던 것만 발견하게 되니 근신간에 마음을 상하겠습니다. 남쪽으로 가지 마십시오. 만일 이를 어기고 그 쪽으로 가게 되면 꿋꿋하는 바를 못 이루고 진행하던 사업마저 피해를 입겠습니다.','택구가 늘겠고 토지도 늘겠습니다. 집안은 경사에 운운이 들어 즐거움으로 가득하겠습니다. 재물이 왕성하고 남 몸이 구해지니 마음은 화평을 찾겠습니다. 그러나 이 달에는 남으로 인해 피해를 받을 수 있으니 남의 말을 믿지 마십시오.','일은 많으나 이루어지는 것은 별로 없겠습니다. 흉함에 겨운 탄식소리가 높으니 벗사들이 칼을 잃은 격이니 길 떠난 사람이 길을 잊음과 같겠습니다. 바라던 것을 이루지 못하고 소망하던 것도 물거품 같으니 세상이 그저 한탄 스럽기만 하겠습니다.','돌을 쌓아서 옛을 보는 운세이니 그간 노고와 인내를 그 누가 칭찬치 않겠습니까. 바라던 소망을 다 이루고 재물이 다시 왕성해지겠습니다. 그러나 문서를 조심하십시오. 경솔히 행동하다 문서로 인하여 속칭하는 일이 생기겠습니다.','흉한 일 중에도 길한 운세가 찾아들게 되니 초월은 힘들고 뒤에는 좋아지겠습니다. 남과 다투지 마십시오. 반드시 망패를 보게되고 후회한들 소용이 없게 됩니다. 이 달 말의 운은 날이 자무는데 길 잃은 행인과 같이 마음이 어지럽고 속만 타우게 되는 공고한 운입니다.','암에 찾아서 불전에 손을 모으고 기도하십시오. 기도하면 구하는 대로 이루어지겠습니다. 배우자나 아들에게 질병이 친척하니 집안에 근심이 있겠습니다. 동쪽으로 가면 귀인이 나를 도우겠습니다. 모질려 행운을 잡으십시오.','남의 말을 함부로 믿지 마십시오. 일이 협력된 곳으로 옮겨가게 될 수 있습니다. 하고자 하는 의욕이 있어 도처에 일을 바이지만 기대하지 않는 게 좋습니다. 머리도 없고 꼬리도 없는 협력한 일입니다. 일에는 정한 이치가 있으니 분수를 지키지 않으면 해를 입겠습니다.','멀리가지 마십시오. 반드시 액을 당하게 되겠습니다. 도둑이 들어 가정을 습칠 운세이니 늘 조심해야겠습니다. 만일 분수를 지키지 않고 먼길되이 행동하게 되면 뜻밖의 원수를 만나게 되니 신중히 행동해야 합니다.','길한 운세가 꾸준히 이어지지 않으니 세상사가 나를 무렵게 만드는 형상입니다. 재물을 구하려고 이리저리 애써보지만 마음껏 것처럼 내게로 와 주지 않아 속을 태우겠습니다. 남쪽에는 길함이 있으니 그 쪽으로 가서 뜻을 펴보면 꽤 소원을 이룰 수도 있겠습니다.','2025-03-02 12:04:02.398918+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (439,'071','Pro -Day Pro -Japanese也避开了敌人并出门，敌人用刀奔跑。如果您离开门，您将迷路。总体而言，今年不好。如果您只能根据利润而筋疲力尽，并采取行动，那么您将被视为一种美德。我会失去东西或获得良好的位置。但是，如果您避免遥远的情况，您将有厄运。在保留喷泉的同时，不要试图急忙做新事情。相反，慢慢开始会产生良好的结果。今年，家庭将感到沮丧，因为屋子里会有韧性，遭受痛苦，却不担心。但是，如果您如此紧张以至于不会陷入疏忽，但是如果尝试，您将进来。','这是一种将创造财富的运输工具。但是，即使发生运气，您也可能会在获得后睡觉。此外，财富只试图出去，而且没有收集到我身上，所以即使我尝试了也无法做到。走很长一段路不好。继续做您在家里做的事情。','似乎在外面很好，但是如果您尝试看到水果，您会很丑陋。一切都超越了马，因此不会完成。我听着山，爬上了山。','那天不是明亮的，水像云一样被阻塞。有一个黄花，所以要小心所有事情，然后急忙准备。接近受精是不好的。您应该小心，该机构是我的亲戚。','政府将激活。如果您在与他人的交易中获利，您将只会发现我不利的东西。不要向南走。如果您将其打破并去那里，您将无法实现该项目。','房屋将越来越多，土地将增加。由于坡上的运气，房子将充满欢乐。财富是有活力的，尸体得救了，所以我会寻求和平。但是这个月，您可能会受到他人的破坏，因此不要相信别人。','有很多工作，但这并不多。由于丑陋而产生了很高的哀叹，因此这些核失去了剑。这就像一个泡沫，我无法实现我想要的东西，所以世界只是在哀叹。','看到旧的石头是一件好意，那么谁不会赞美辛勤的工作和耐心呢？我将实现自己的愿望，我的财富将再次充满活力。但是要小心文档。我几乎没有采取行动。','即使在丑陋的工作中，漫长的财富也会到来，因此超越是困难的，它会更好。不要与他人争论。您必须看到漫画，不会后悔。本月底的运气是一个可靠的运气，那就是心脏头晕，只像失落的行人一样燃烧。','找到癌症并收集手祈祷。如果您祈祷，它将按照您的要求完成。我有一个与配偶或儿子的亲戚，所以我担心房子。如果您向东走，贵族会帮助我。祝你好运。','不要相信别人。您也许可以搬去合作工作。我有动力在任何地方做到这一点，但我不期望。这是一项没有头，没有尾巴的合作作品。有一个合理的工作原因，因此，如果您不保留喷泉，我们会伤害您。','不要走很远。您一定会得到液体。小偷是建立家庭的星座，所以要小心。如果您在不保留喷泉的情况下做了很长的路要走，您将遇到一个意想不到的敌人。','漫长的财富不会继续，因此世界的历史使我周围。我试图找到财富，但我不会尽可能多地来找我。南方还有很长的路要走，因此，如果您去那一边，您可以做出公平的愿望。','2025-03-02 12:04:02.398918+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (510,'071','また、日本 - 日本も敵を避けて外に出て、敵はナイフで走ります。ドアを離れると、迷子になります。全体として、今年は良くありません。あなたが堅実さに疲れ果てており、利益に応じてのみ行動する場合、あなたは美徳として指で触れられます。私は物事を失うか、良い立場になります。ただし、遠くに避けると、運が悪くなります。噴水を維持しながら、急いで緊急に新しいことをしようとしないでください。むしろ、ゆっくりと始めると良い結果が得られます。今年、家族は家に強さがあり、苦しみ、心配していないため、落ち込んでしまいます。しかし、あなたが非常に緊張しているのであなたが過失に陥らないでしょうが、あなたが試してみると、あなたは入ってくるでしょう。','それは富を生み出す輸送です。しかし、運が起こったとしても、あなたはあなたが得た後にあなたの睡眠を失うかもしれません。さらに、富は外に出ようとするだけで、私には集まらないので、試してもできません。長い道のりで行くのは良くありません。あなたがあなたの家でしたことを続けてください。','外側は良いようですが、果物を見ようとすると醜いでしょう。すべてが馬を超えているので、それは行われません。私は山に耳を傾け、山に登った。','その日は明るくなく、水は雲のように塞がれていました。 huangsuがありますので、すべてに注意し、急いで準備してください。受精に近づくのは良くありません。あなたは、施設が私との親relativeであることに注意する必要があります。','政府は活性化します。他の人との取引で利益を得ると、私にとって不利な点だけが見つかります。南に行かないでください。あなたがそれを壊してそこに行くと、あなたはプロジェクトを達成することができません。','家が増え、土地が増加します。家は斜面の運のために喜びに満ちています。富は活発で、体は救われているので、私は平和を探します。しかし、今月は他の人に損傷を受ける可能性があるので、他の人を信じないでください。','多くの作業がありますが、それはあまり起こりません。醜いために嘆き悲しみが高いので、核は剣を失いました。私が望んでいたことを達成できなかったのはバブルのようなものなので、世界はただ嘆き悲しんでいます。','古い石を見るのは幸運なことです。私は自分の願いを満たし、私の富は再び活発になります。ただし、文書には注意してください。私はほとんど行動しません。','醜い仕事でさえ、長い財産が来るので、超越は困難であり、それはより良いものになります。他の人と議論しないでください。あなたは漫画を見なければなりません、そしてあなたはそれを後悔しないでしょう。今月末の幸運は、心がめまいがあり、失われた歩行者のように燃えるだけであるという堅実な運です。','癌を見つけて手を集めて祈ります。あなたが祈るなら、それはあなたが尋ねるように行われます。私には配偶者や息子との関係があるので、家が心配です。あなたが東に行くなら、貴族は私を助けてくれます。幸運を祈ります。','他の人を信じないでください。あなたは協力して働くことができるかもしれません。私はどこでもそれをやりたいと思っていますが、私はそれを期待していません。それは頭と尾のない協力的な仕事です。仕事には合理的な理由があるので、噴水を維持しなければ、私たちはあなたに害を及ぼします。','遠くに行かないでください。あなたはきっと液体を手に入れるでしょう。泥棒は家族を作るための星占いですので、注意してください。噴水を維持せずに長い道のりを歩むと、予期せぬ敵に会うでしょう。','長所は続かないので、世界の歴史は私の周りに私を作ります。私は富を見つけようとしますが、できる限り私のところに来ません。南部には長い道のりがありますので、その側に行くと公正な願いを唱えることができます。','2025-03-02 12:04:02.398918+00','j');
